 function CarteArtiste({nom, desc, url}){

    if(nom==="Lich'ar"){
        const photo=img_lichar;
    }

    return(
        <div>
            <h3>{nom}</h3>
            <p>{desc}</p>
            <img src={photo} alt={"photo du DJ " +nom}></img>

        </div>
    )


}

export default CarteArtiste;
